import styled from "styled-components";

export const ContactHedding = styled.div`
    margin:0;
    padding:0;
`;
export const ContactLeft = styled.div`
    p{
        margin-bottom: 35px;
    }
`;
export const ContactLeftBottom = styled.div`
    margin: 15px 0;
    h5{
        margin-bottom: 25px;
    }
    ul li a{
        font-size: 16px;
    }
    ul li{
        line-height: 30px;
        font-size: 16px;
        span svg{
            font-size: 20px;
            margin-right: 10px;
        }
    }
`;
